import React from "react";

function VideoBG(){
    return (
        <>
        <video autoPlay muted loop>
        <source src="https://www.pexels.com/video/4507628/download/?h=1080&w=1920"> </source>
      </video>
      <div class="overlay"></div>
      </>
    )
}

export default VideoBG;
